import './HeaderPage.css'
<div className="modelS_home">
<div className="modelS_text">
  <h2>Model S</h2>
</div>
</div>
const HeaderPage = (background,title,description,range,speed,time,horsepower) => {
    return ( 
        <div className="header">
        <div className="header_text">
          <h2>{title}</h2>
        </div>
   </div>
     );
}
 
export default HeaderPage;
